import React from 'react';

const User = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'center' }}>
        <h1>Cadastro</h1>

        <div style={{ 
          display: 'flex', 
          flexDirection: 'column',
          width: '80vh' 
        }}>
          <input type="text" />
          <input type="password" />
        </div>
    </div>
  );
}

export default User;
